import React from 'react';
import { Routes, Route, Link } from 'react-router-dom';
import HomePage from '../HomePage';
import ProductList from '../ProductList';
import Login from '../Auth/Login';
import Signup from '../Auth/Signup';
import { CartProvider } from "..";
import Cart from '../Cart/Cart';
import Products from './ProductPage'; // âœ… import Products
import Orders from './Orders'; // âœ… import Orders
import Settings from './ProfileUpdate'; // âœ… import Settings
import Dashboard from './Dashboard';
import ProtectedRoute from '../ProtectedRoute';
import { useAuth } from '../contexts/AuthContext';
import '../app.css';
import { ToastContainer, toast } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";

export default function App() {
  const { isLoggedIn, logout, user } = useAuth();

  const handleLogout = () => {
    logout();
    toast.success("Logout Successful!");
  };

  return (
    <CartProvider>
      <div>
        {/* --- NAVBAR --- */}
        <nav className="navbar">
          <div className="nav-left">
            <Link className="logo" to="/">GuruKrupa GiftArticle</Link>
            <div className="nav-links">
              <Link to="/">Home</Link>
              <Link to="/products">Products</Link>
              {user?.role === "admin" && <Link to="/admin">Admin</Link>}
            </div>
          </div>

          <div className="nav-center">
            <input className="search-box" placeholder="Search products..." />
          </div>

          <div className="nav-right">
            <Link className="cart-link" to="/cart">
              ðŸ›’ <span className="cart-badge"></span>
            </Link>
            <div className="auth-links">
              {isLoggedIn ? (
                <>
                  <span className="user-info">Welcome, {user?.name || "User"}</span>
                  <button onClick={handleLogout} className="logout-btn">Logout</button>
                </>
              ) : (
                <>
                  <Link to="/login">Login</Link>
                  <Link to="/signup" className="signup-btn">Signup</Link>
                </>
              )}
            </div>
          </div>
        </nav>

        <ToastContainer position="top-right" autoClose={2000} />

        {/* --- ROUTES --- */}
        <div className="page-container">
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/products" element={<ProductList />} />
            <Route path="/login" element={<Login />} />
            <Route path="/signup" element={<Signup />} />
            <Route path="/cart" element={<Cart />} />

            {/* --- Admin Routes --- */}
            <Route path="/admin" element={<ProtectedRoute><AdminPanel /></ProtectedRoute>}>
              <Route path="dashboard" element={<Dashboard />} />
              <Route path="products" element={<Products />} />
              <Route path="orders" element={<Orders />} />
              <Route path="settings" element={<Settings />} />
            </Route>
          </Routes>
        </div>
      </div>
    </CartProvider>
  );
}
